(1, 'Masteri Thảo Điền', 'masteri-thao-dien', NULL, '<h2 style="text-align: center;">\r\n	<span style="font-size:28px;"><span style="color:#ff9900;"><strong>Vị Trí</strong></span></span>\r\n</h2>\r\n\r\n<p style="text-align: center;">\r\n	Tọa lạc ngay tại trung tâm Thảo Điền Quận 2, mặt tiền Xa Lộ Hà Nội, Masteri Thảo Điền sở hữu vị trí đẳng cấp trong quy hoạch trung tâm thành phố mới, nơi bạn có thể phóng tầm nhìn ra toàn cảnh thành phố.<br>\r\n	Kết nối trực tiếp với hệ thống giao thông huyết mạch và ngay tại nhà ga An Phú (ga số 7) của tuyến đường sắt đô thị Bến Thành &ndash; Suối Tiên, bạn và gia đình chỉ mất 7 phút vào trung tâm quận 1 và các quận lân cận. Cách sông Sài Gòn 200m, bạn có thể hưởng trọn vẹn một không gian sống thoáng đãng với nắng gió tự nhiên.Sự hòa quyện giữa nhịp sống hiện đại và không gian xanh yên bình chính là điểm nhấn độc đáo của Masteri Thảo Điền.\r\n</p>\r\n\r\n<p style="text-align: center;">\r\n	<img alt="" src="http://localhost:8080/sieuthibds/images/uploads/images/masterithaodien/masteri-thao-dien-vi-tri.jpg" style="width: 100%; height: 100%;">\r\n</p>\r\n\r\n<h2 style="text-align: center;">\r\n	<span style="color:#ff9900;"><span style="font-size:28px;"><strong>&nbsp;Các Loại Hình Căn Hộ:</strong></span></span>\r\n</h2>\r\n\r\n<p style="text-align: center;">\r\n	1 phòng ngủ: 48m2 &ndash; 51m2<br>\r\n	2 phòng ngủ: 65m2 &ndash; 78m2<br>\r\n	3 phòng ngủ: 93m2 &ndash; 100m2<br>\r\n	4 phòng ngủ: 130m2<br>\r\n	Duplex: 130m2 &ndash; 160m2<br>\r\n	Penthouses: 200m2 &ndash; 300m2\r\n</p>\r\n\r\n<h2 style="text-align: center;">\r\n	<span style="color:#ff9900;"><span style="font-size:28px;"><strong>Kết nối thuận tiện trong thành phố</strong></span></span>\r\n</h2>\r\n\r\n<p>\r\n	<span style="color:#ff9900;"><span style="font-size:28px;"><strong><img alt="" src="http://localhost:8080/sieuthibds/images/uploads/images/masterithaodien/masteri-thao-dien-ket-noi.jpg" style="width: 100%; height: 100%;"></strong></span></span>\r\n</p>', 'images/uploads/images/masterithaodien/masteri-thao-dien.jpg', NULL, 0, NULL, 1, 1, 1, '2018-10-10 12:31:00', '2018-10-10 16:40:46', NULL, 1, 47),
